import React from "react";
import "./HelloWorld.css";

import Title from "./../../components/Title";
import TextArea from "./../../components/TextArea";
const helloWorldBot = require("./../../libs/HelloWorld/helloWorldBot.js");

const HelloWorldPage = () => {
  return (
    <div class="main-page">
      <Title titleText="HelloWorld" />
      <div class="content">
        <div class="page-description">
          Welcome to the hello world app, this app lets you select a programming
          language and then it will show you how to create a hello world for the
          application.
        </div>
        <TextArea>{helloWorldBot}</TextArea>
      </div>
    </div>
  );
};

export default HelloWorldPage;
